    "content": "Jump to content From Wikipedia, the free encyclopedia General-purpose programming language This article may contain unverified or indiscriminate information in embedded lists. Please help clean up the lists by removing items or incorporating them into the text of the article. (October 2025) Python Paradigm Multi-paradigm: object-oriented,[1] procedural (imperative), functional, structured, reflective Designed by Guido van Rossum Developer Python Software Foundation First appeared 20 February 1991; 34 years ago (1991-02-20)[2] Stable release 3.14.2[3] / 5 December 2025; 9 days ago (5 December 2025) Typing discipline Duck, dynamic, strong;[4] optional type annotations[a] Memory management Garbage-collected OS Cross-platform including 32-bit Windows 10 and e.g. for mobile; Android and iOS (both 64-bit)[b] License Python Software Foundation License Filename extensions .py, .pyw, .pyz,[11] .pyi, .pyc, .pyd Website python.org Major implementations CPython, PyPy, MicroPython, CircuitPython, IronPython, Jython, Stackless Python Dialects Cython, RPython, Starlark[12] Influenced by ABC,[13] Ada,[14][failed verification] ALGOL 68,[15] APL,[16] C,[17] C++,[18] CLU,[19] Dylan,[20] Haskell,[21][16] Icon,[22] Lisp,[23] Modula-3,[15][18] Perl,[24] Standard ML[16] Influenced Apache Groovy, Boo, Cobra, CoffeeScript,[25] D, F#, GDScript, Go, JavaScript,[26][27] Julia,[28] Mojo,[29] Nim, Ring,[30] Ruby,[31] Swift,[32] V[33] Python Programming at Wikibooks This article is part of a series on Python Python frameworks BlueBream CherryPy CubicWeb Django FastAPI Flask Google App Engine Grok Kivy mod_wsgi Nevow Pylons Pyramid Python Paste Quixote RapidSMS Robot Framework Spyce Tornado TurboGears web2py Zope 2 Python libraries appJar Anaconda Apache MXNet Apache Singa Astropy Beautiful Soup Biopython Chainer CatBoost Cheetah Construct Cubes CuPy Dask DEAP DeepSpeed Enthought Genshi Gensim graph-tool Horovod Imaging Library IPython JAX Jinja Keras Manim Matplotlib Mako MindSpore mlpy MNE-Python NLTK NetworkX NeuroKit NumPy OceanParcels Orange Panda3D Pandas PlaidML Plotly ProbLog pvlib python PyGObject PyGTK PyMC PyObjC Pygame PyQt PyroBot library PySide PyTorch PyTorch Lightning Python-Ogre Qiskit QLattice QAL RDFLib RDKit RPyC Sage Manifolds SageMath ScientificPython scikit-learn scikit-multiflow SciPy SimpleITK spaCy Sphinx SQLAlchemy SQLObject Storm SymPy TensorFlow Theano Tkinter Twisted TomoPy Transformers Veusz VPython wxPython XDMF Python IDEs Atom / Pulsar Codelobster EasyEclipse Eclipse Emacs Eric Geany Google Colab IDLE Jupyter Notebook Kaggle Notebooks Komodo IDE NetBeans Ninja-IDE PyCharm PythonAnywhere Python Tools for VS Replit Spyder Thonny Vim Visual Studio Code Wing IDE Python implementations ActivePython CLPython CPython Cython Intel Dist. for Python IronPython Jython MicroPython Nuitka Numba Parrot Psyco PyPy Pyrex Python for S60 Shed Skin Stackless Python Unladen Swallow See also History of Python List of Python books List of Python conferences List of Python software List of unit testing frameworks for Python Outline of the Python programming language Python Package Index (PyPI) and pip Python Software Foundation Python syntax and semantics Computer programming portal Python Programming (Wikibook) v t e Python is a high-level, general-purpose programming language. Its design philosophy emphasizes code readability with the use of significant indentation.[34] Python is dynamically type-checked and garbage-collected. It supports multiple programming paradigms, including structured (particularly procedural), object-oriented and functional programming. Guido van Rossum began working on Python in the late 1980s as a successor to the ABC programming language. Python 3.0, released in 2008, was a major revision and not completely backward-compatible with earlier versions. Beginning with Python 3.5,[35] capabilities and keywords for typing were added to the language, allowing optional static typing.[36] As of 2025[update], the Python Software Foundation supports Python 3.10, 3.11, 3.12, 3.13, and 3.14, following the projects annual release cycle and five-year support policy. Earlier versions in the 3.x series have reached end-of-life and no longer receive security updates. Python has gained widespread use in the machine learning community.[37][38][39][40] It is widely taught as an introductory programming language.[41] Since 2003, Python has consistently ranked in the top ten of the most popular programming languages in the TIOBE Programming Community Index, which ranks based on searches in 24 platforms.[42] History Main article: History of Python The designer of Python, Guido van Rossum, at PyCon US 2024 Python was conceived in the late 1980s[43] by Guido van Rossum at Centrum Wiskunde \u0026 Informatica (CWI) in the Netherlands.[44] It was designed as a successor to the ABC programming language, which was inspired by SETL,[45] capable of exception handling and interfacing with the Amoeba operating system.[13] Python implement",
