    "content": "Jump to content Coordinates: 53Â°08â€²N 1Â°23â€²Wï»¿ / ï»¿53.13Â°N 1.38Â°Wï»¿ / 53.13; -1.38 From Wikipedia, the free encyclopedia Country within the United Kingdom For other uses, see England (disambiguation). Not to be confused with United Kingdom. England Flag Anthem: None officially; Predominantly \"God Save the King\"[a] Location of England (dark green) â€“ in Europe (green \u0026 dark grey) â€“ in the United Kingdom (green) Status Country Capital and largest city London 51Â°30â€²N 0Â°7â€²Wï»¿ / ï»¿51.500Â°N 0.117Â°Wï»¿ / 51.500; -0.117 National language English, BSL[1] Regional languages Cornish Ethnic groups (2021)[2] 81.0% White 9.6% Asian 4.2% Black 3.0% Mixed 2.2% other Religion (2021)[2] 46.3% Christianity 36.7% no religion 6.7% Islam 1.8% Hinduism 0.9% Sikhism 0.5% Judaism 0.5% Buddhism 0.6% other 6.0% not stated Demonym English[b] Sovereign state Legal jurisdiction United Kingdom England and Wales Government Direct rule by the UK Government within a parliamentary constitutional monarchy â€¢ Monarch Charles III Parliament of the United Kingdom â€¢ House of Commons 543 MPs (of 650) Establishment â€¢ Unification of Angles, Saxons and Danes By 12 July 927 â€¢ Union with Scotland 1 May 1707 Area â€¢ Total[d] 132,932 km2 (51,325 sq mi)[3] â€¢ Land[c] 130,310 km2 (50,310 sq mi)[4] Population â€¢ 2024 estimate 58,620,101[4] â€¢ 2021 census 56,490,048[2] â€¢ Density 450/km2 (1,165.5/sq mi)[4] GVA 2023 estimate â€¢ Total Â£2.113 trillion â€¢ Per capita Â£36,632[5] GDP (nominal) 2023 estimate â€¢ Total Â£2.330 trillion â€¢ Per capita Â£40,382[6] Currency Pound sterling (GBP; Â£) Time zone UTC+0 (GMT) â€¢ Summer (DST) UTC+1 (BST) Date format dd/mm/yyyy (AD) Calling code +44 ISO 3166 code GB-ENG England is a country that is part of the United Kingdom. It is located on the island of Great Britain, of which it covers about 62%, and more than 100 smaller adjacent islands. England shares a land border with Scotland to the north and another land border with Wales to the west, and is otherwise surrounded by the North Sea to the east, the English Channel to the south, the Celtic Sea to the south-west, and the Irish Sea to the west. Continental Europe lies to the south-east, and Ireland to the west. At the 2021 census, the population was 56,490,048. London is both the largest city and the capital. The area now called England was first inhabited by modern humans during the Upper Paleolithic. It takes its name from the Angles, a Germanic tribe who settled during the 5th and 6th centuries. England became a unified state in the 10th century and has had extensive cultural and legal impact on the wider world since the Age of Discovery, which began during the 15th century.[7] The Kingdom of England, which included Wales after 1535, ceased to be a separate sovereign state on 1 May 1707, when the Acts of Union brought into effect a political union with the Kingdom of Scotland that created the Kingdom of Great Britain.[8] England is the origin of the English language, the English legal system (which served as the basis for the common law systems of many other countries), association football, and the Anglican branch of Christianity; its parliamentary system of government has been widely adopted by other nations.[9] The Industrial Revolution began in 18th-century England, transforming its society into the world\u0027s first industrialised nation.[10] England is home to the two oldest universities in the English-speaking world: the University of Oxford, founded in 1096, and the University of Cambridge, founded in 1209. Both universities are ranked amongst the most prestigious in the world.[11][12] England\u0027s terrain chiefly consists of low hills and plains, especially in the centre and south. Upland and mountainous terrain is mostly found in the north and west, including Dartmoor, the Lake District, the Pennines, and the Shropshire Hills. The London metropolitan area has a population of over 15 million as of 2025, representing the United Kingdom\u0027s largest metropolitan area. England\u0027s population of 56.3 million comprises 84% of the population of the United Kingdom, largely concentrated around London, the South East, and conurbations in the Midlands, the North West, the North East, and Yorkshire, which each developed as major industrial regions during the 19th century.[13] Toponymy See also: Toponymy of England The name \"England\" is derived from the Old English name Englaland, which means \"land of the Angles\".[14] The Angles were one of the Germanic tribes that settled in Great Britain during the Early Middle Ages. They came from the Angeln region of what is now the German state of Schleswig-Holstein.[15] The earliest recorded use of the term, as \"Engla londe\", is in the late-ninth-century translation into Old English of Bede\u0027s Ecclesiastical History of the English People. The term was then used to mean \"the land inhabited by the English\", and it included English people in what is now south-east Scotland but was then part of the English kingdom of Northumbria. The Anglo-Saxon Chronicle recorded that the D",
